  `seq` tinyint(2) DEFAULT NULL COMMENT '顺序',
  `delete_flag` tinyint(1) DEFAULT NULL COMMENT '删除状态：1：已删除；0：未删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=226 DEFAULT CHARSET=utf8;

